import React from "react";
import { Link } from "react-router-dom";
import classes from "./Header.module.css";

const Header = () => {
  return (
    <nav>
      <ul className={classes.button}>
        <li>
          <button>
            <Link to="/welcome">Welcome</Link>
          </button>
        </li>
        <li>
          <button>
            <Link to="/products">Products</Link>
          </button>
        </li>
      </ul>
    </nav>
  );
};

export default Header;
